    {user_id: 2, user_login: "User", user_password: "Pass12345", user_role: "User", user_email: "firstuser@mail.ru"}, 
    {user_id: 3, user_login: "Moderator 1", user_password: "Mod@12345", user_role: "Moderator", user_email: "moderator_1@mail.ru"}, 
    {user_id: 4, user_login: "Test", user_password: "Password", user_role: "User", user_email: "test@mail.ru"}
